export const quizData = {
  totalQuestions: 10,
  perQuestionScore: 1,
  questions: [
    {
      question: "Which keyword is used to define a variable in COBOL?",
      choices: ["DATA", "VAR", "PIC", "VALUE"],
      correctAnswer: "DATA"
    },
    {
      question: "In FORTRAN, which operator is used for addition?",
      choices: ["+", "-", "*", "/"],
      correctAnswer: "+"
    },
    {
      question: "Which of the following is used to display output in BASIC?",
      choices: ["PRINT", "DISPLAY", "OUTPUT", "SHOW"],
      correctAnswer: "PRINT"
    },
    {
      question: "Which function is used to read input from the user in FORTRAN?",
      choices: ["READ", "INPUT", "GET", "SCANNER"],
      correctAnswer: "READ"
    },
    {
      question: "In COBOL, which keyword is used to define a variable?",
      choices: ["DATA", "VAR", "PIC", "VALUE"],
      correctAnswer: "PIC"
    },
    {
      question: "Which of the following is the first step in a FORTRAN program?",
      choices: ["DECLARE", "PROGRAM", "INTEGER", "READ"],
      correctAnswer: "PROGRAM"
    },
    {
      question: "Which operator is used for string concatenation in JavaScript?",
      choices: ["+", "-", "*", "&"],
      correctAnswer: "+"
    },
    {
      question: "In BASIC, which command is used to end the program?",
      choices: ["EXIT", "END", "STOP", "QUIT"],
      correctAnswer: "END"
    },
    {
      question: "In FORTRAN, which statement is used to display output on the screen?",
      choices: ["PRINT", "DISPLAY", "OUTPUT", "SHOW"],
      correctAnswer: "PRINT"
    },
    {
      question: "Which of the following is used to define a function in JavaScript?",
      choices: ["def", "function", "method", "lambda"],
      correctAnswer: "function"
    }
  ]
};
